	var createGLShader = function (gl, type, src) {
		var shader = gl.createShader(type);
		gl.shaderSource(shader, src);
		gl.compileShader(shader);
		if(!gl.getShaderParameter(shader, gl.COMPILE_STATUS)){
			console.log("warning: shader failed to compile!");
			console.log(gl.getShaderInfoLog(shader));
			return null;
		}
		return shader;
	}

	var createGLProgram = function (gl, vSrc, fSrc) {
		var program = gl.createProgram();
		var vShader = createGLShader(gl, gl.VERTEX_SHADER, vSrc);
		var fShader = createGLShader(gl, gl.FRAGMENT_SHADER, fSrc);
		gl.attachShader(program, vShader);
		gl.attachShader(program, fShader);
		gl.linkProgram(program);
		if(!gl.getProgramParameter(program, gl.LINK_STATUS)){
			console.log("warning: program failed to link");
			return null;
		}
		return program;
	}

	var createGLBuffer = function (gl, data, usage) {
		var buffer = gl.createBuffer();
		gl.bindBuffer(gl.ARRAY_BUFFER, buffer);
		gl.bufferData(gl.ARRAY_BUFFER, data, usage);
		gl.bindBuffer(gl.ARRAY_BUFFER, null);
		return buffer;
	}

	var findAttribLocations = function (gl, program, attributes) {
		var out = {};
		for(var i = 0; i < attributes.length;i++){
			var attrib = attributes[i];
			out[attrib] = gl.getAttribLocation(program, attrib);
		}
		return out;
	}

	var findUniformLocations = function (gl, program, uniforms) {
		var out = {};
		for(var i = 0; i < uniforms.length;i++){
			var uniform = uniforms[i];
			out[uniform] = gl.getUniformLocation(program, uniform);
		}
		return out;
	}

	var enableLocations = function (gl, attributes) {
		for(var key in attributes){
			var location = attributes[key];
			gl.enableVertexAttribArray(location);
		}
	}

	var disableLocations = function (gl, attributes) {
		for(var key in attributes){
			var location = attributes[key];
			gl.disableVertexAttribArray(location);
		}
	}

	var createGLTexture = function (gl, image) {
		var texture = gl.createTexture();
		gl.bindTexture(gl.TEXTURE_2D, texture);
		gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, image);
		gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MAG_FILTER, gl.LINEAR);
		gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER,  gl.LINEAR);
		gl.generateMipmap(gl.TEXTURE_2D);
		gl.bindTexture(gl.TEXTURE_2D, null);
		return texture;
	}

	var Bean = function Bean(name, position, size, theta, color) {
		this.name = name;
		this.position = position || [0,0,0];
		this.size = size || 1.0;
		this.color = color || [1,1,0];
		this.theta = theta || 0;
		this.program = null;
		this.attributes = null;
		this.uniforms = null;
		// this.buffers = [null, null, null, null];
		this.buffers = [null, null];
		// this.texture1 = null;
		// this.texture2 = null;
	}

	Bean.prototype.init = function(drawingState) {
		// var gl = drawingState.gl;
		var canvas=drawingState.canvas;
		var gl = canvas.getContext("experimental-webgl");
		// console.log(twgl.isWebGL1(gl));
		// console.log(twgl.isWebGL2(gl));

		this.program = createGLProgram(gl, vertexSource, fragmentSource);
		// this.attributes = findAttribLocations(gl, this.program, ["vpos","vnormal", "vtex1","vtex2"]);
		// this.uniforms = findUniformLocations(gl, this.program, ["time", "view", "proj", "model","lightdir", "cubecolor", "texSampler1", "texSampler2"]);
		this.attributes = findAttribLocations(gl, this.program, ["vpos","vnormal"]);
		this.uniforms = findUniformLocations(gl, this.program, ["view", "proj", "model","lightdir", "normalMatrix", "invVT"]);

		// this.texture1 = createGLTexture(gl, image1);
		// this.texture2 = createGLTexture(gl, image2);

		this.buffers[0] = createGLBuffer(gl, vpos, gl.STATIC_DRAW);
		this.buffers[1] = createGLBuffer(gl, vnormal, gl.STATIC_DRAW);
		// this.buffers[2] = createGLBuffer(gl, vtex1, gl.STATIC_DRAW);
		// this.buffers[3] = createGLBuffer(gl, vtex2, gl.STATIC_DRAW);
		}

	Bean.prototype.draw = function(drawingState) {
		// var gl = drawingState.gl;
		var canvas=drawingState.canvas;
		var gl = canvas.getContext("experimental-webgl");
		
		gl.useProgram(this.program);

		var modelM = twgl.m4.scaling([this.size,this.size,this.size]);
		twgl.m4.setTranslation(modelM,this.position,modelM);
		twgl.m4.rotateY(modelM, this.theta, modelM);


		var normalMatrix = twgl.m4.inverse(twgl.m4.transpose(drawingState.view));
		// twgl.m3.fromMat4(invVT, drawingState.view);
    	var invVT = twgl.m4.inverse(drawingState.view);

  // twgl.m3.normalFromMat4(normalMatrix, drawingState.view);
		// twgl.m3.fromMat4(invVT, drawingState.view);
  //   	twgl.m3.invert(invVT,invVT);

		
		gl.uniformMatrix4fv(this.uniforms.proj, gl.FALSE, drawingState.proj);
		gl.uniformMatrix4fv(this.uniforms.view, gl.FALSE, drawingState.view);
		gl.uniformMatrix4fv(this.uniforms.model, gl.FALSE, modelM);
		gl.uniformMatrix4fv(this.uniforms.normalMatrix, gl.FALSE, normalMatrix);
		gl.uniformMatrix4fv(this.uniforms.invVT, gl.FALSE, invVT);
		gl.uniform3fv(this.uniforms.lightdir, drawingState.sunDirection);
		// gl.uniform3fv(this.uniforms.cubecolor, this.color);
		gl.uniform1i(this.uniforms.skybox, 0);
		// gl.uniform1i(this.uniforms.texSampler2, 1);

		// gl.activeTexture(gl.TEXTURE0);
		// gl.bindTexture(gl.TEXTURE_2D, this.texture1);
	   
		// gl.activeTexture(gl.TEXTURE1);
		// gl.bindTexture(gl.TEXTURE_2D, this.texture2);

		enableLocations(gl, this.attributes);

		gl.bindBuffer(gl.ARRAY_BUFFER, this.buffers[0]);
		gl.vertexAttribPointer(this.attributes.vpos, 3, gl.FLOAT, false, 0, 0);

		gl.bindBuffer(gl.ARRAY_BUFFER, this.buffers[1]);
		gl.vertexAttribPointer(this.attributes.vnormal, 3, gl.FLOAT, false, 0, 0);

		// gl.bindBuffer(gl.ARRAY_BUFFER, this.buffers[2]);
		// gl.vertexAttribPointer(this.attributes.vtex1, 2, gl.FLOAT, false, 0, 0);

		// gl.bindBuffer(gl.ARRAY_BUFFER, this.buffers[3]);
		// gl.vertexAttribPointer(this.attributes.vtex2, 2, gl.FLOAT, false, 0, 0);

		gl.drawArrays(gl.TRIANGLES, 0, 28320);

		disableLocations(gl, this.attributes);
	}

